        border: '2px solid black',
        ':hover': {
            backgroundColor: 'lightgreen',
            color: 'black'
        }
    }
    return (
        <div className="container" style={style}>
        <p>PAGE 3/6</p>
        <h2>STP</h2>
        <p>Know your customers</p>
        Segmentation
        <input />
        <br/>
        Targeting
        <input />
        <br/>
        Positioning
        <input/>
        <br/>
        </div>
        )
}

export default Radium(PageThree);
